contract WealthyHabits is Context, IERC20, Ownable {
    using SafeMath for uint256;

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    mapping(address => bool) private _addressesBlacklist;
    event Blacklist(address indexed blackListed, bool value);

    uint256 private _totalSupply;
    uint256 public _txFee = 1;
    address public _feeAddress;
    uint8 private _decimals;
    string private _symbol;
    string private _name;

    constructor() {
        _name = "Wealthy Habits";
        _symbol = "WHB";
        _decimals = 18;
        _totalSupply = 500000000 * 10**_decimals;
        _feeAddress = 0xED7C59635D40fBF9D9F5C153C5Fc8dA2DEF83d8a;
        _balances[_msgSender()] = _totalSupply;

        emit Transfer(address(0), _msgSender(), _totalSupply);
    }

    /**
     * @dev Returns the token decimals.
     */
    function decimals() public view override returns (uint8) {
        return _decimals;
    }

    /**
     * @dev Returns the symbol of the token, usually a shorter version of the
     * name.
     */
    function symbol() public view override returns (string memory) {
        return _symbol;
    }

    /**
     * @dev Returns the name of the token.
     */
    function name() public view override returns (string memory) {
        return _name;
    }

    /**
     * @dev See {IERC20-totalSupply}.
     */
    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    /**
     * @dev See {IERC20-balanceOf}.
     */
    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount)
        public
        override
        returns (bool)
    {
        require(_addressesBlacklist[_msgSender()] == false);
        require(recipient != address(0));
        require(amount <= _balances[_msgSender()]);

        _balances[_msgSender()] = _balances[_msgSender()].sub(amount);

        uint256 tempAmount = amount;
        if (_txFee > 0 && _msgSender() != _feeAddress) {
            uint256 txFeeAmount = tempAmount.div(uint256(100 / _txFee));
            _balances[_feeAddress] = _balances[_feeAddress].add(txFeeAmount);

            emit Transfer(_msgSender(), _feeAddress, txFeeAmount);
            amount = amount.sub(txFeeAmount);
        }

        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        require(_addressesBlacklist[_msgSender()] == false);
        require(recipient != address(0));
        require(amount <= _balances[sender]);
        require(amount <= _allowances[sender][_msgSender()]);

        _balances[sender] = _balances[sender].sub(amount);
        uint256 tempAmount = amount;

        if (_txFee > 0 && sender != _feeAddress) {
            uint256 txFeeAmount = tempAmount.div(uint256(100 / _txFee));
            _balances[_feeAddress] = _balances[_feeAddress].add(txFeeAmount);
            emit Transfer(sender, _feeAddress, txFeeAmount);
            amount = amount.sub(txFeeAmount);
        }

        _balances[recipient] = _balances[recipient].add(amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()].sub(amount)
        );
        emit Transfer(sender, recipient, amount);
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].add(addedValue)
        );
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        returns (bool)
    {
        uint256 currentAllowance = _allowances[_msgSender()][spender];
        require(
            currentAllowance >= subtractedValue,
            "ERC20: decreased allowance below zero"
        );

        _approve(_msgSender(), spender, currentAllowance.sub(subtractedValue));
        return true;
    }

    /**
     * @dev Sets `amount` as the allowance of `spender` over the `owner`s tokens.
     *
     * This is internal function is equivalent to `approve`, and can be used to
     * e.g. set automatic allowances for certain subsystems, etc.
     *
     * Emits an {Approval} event.
     *
     * Requirements:
     *
     * - `owner` cannot be the zero address.
     * - `spender` cannot be the zero address.
     */
    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _blackList(address _address, bool isBlackListed)
        public
        onlyOwner
        returns (bool)
    {
        require(_addressesBlacklist[_address] != isBlackListed);
        _addressesBlacklist[_address] = isBlackListed;
        emit Blacklist(_address, isBlackListed);
        return true;
    }

    function setTxFee(uint256 txFee) public onlyOwner {
        require(txFee <= 1, "ERC20: Tax fee can not be set to more than 1");
        _txFee = txFee;
    }

    function setTxFeeAddress(address feeAddress) public onlyOwner {
        require(
            feeAddress != address(0),
            "ERC20: FeeAddress set to the zero address"
        );
        _feeAddress = feeAddress;
    }
}
